import React from 'react';

const Footer = () => (
  <footer className="bg-gray-800 text-center text-sm text-gray-400 py-4">
    &copy; {new Date().getFullYear()} HahuTech Solutions. All rights reserved.
  </footer>
);

export default Footer;
